{
  "name": "Gap: Athleta",
  "/my-account/order-history/": {
    "pageSubType": 1,
    "orders": [
      {
        "row": {
          "selector": ".order-package-container"
        },
        "orderID": {
          "selector": ".list-right .order-details-link",
          "manipulator": "splitGetByIndex:#:1"
        },
        "orderDate": {
          "selector": ".order-package-top-container > .list-left",
          "manipulator": "splitGetByIndexLast:on ::formatDate:MMM DD, YYYY"
        }
      }
    ],
    "emptyCartSelector": "#no-order-history-container > h3",
    "products": [
      {
        "row": {
          "selector": ".carousel-item"
        },
        "name": {
          "selector": ".slick-active > div > div > a > div > img",
          "attribute": "alt"
        }
      }
    ]
  },
  "/my-account/order-details/*": {
    "pageSubType": 2,
    "orders": [
      {
        "orderDate": {
          "selector": "#order-summary-container div:nth-child(1) > .list-value",
          "manipulator": "splitGetByIndex:(:0::formatDate:MMMM DD, YYYY"
        },
        "orderID": {
          "selector": "#order-number"
        },
        "cartTotal": {
          "selector": "#order-summary-container div:nth-child(3) >.list-value",
          "manipulator": "splitGetByIndex:(:0"
        },
        "paymentType": {
          "selector": "div#order-summary-container div.list-value > div",
          "manipulator": "splitGetByIndex: ending:0"
        }
      }
    ],
    "products": [
      {
        "row": {
          "selector": ".product-item-info-container"
        },
        "name": {
          "selector": ".product-item-name"
        },
        "link": {
          "selector": ".product-item-name",
          "attribute": "href"
        },
        "price": {
          "selector": ".product-item-details-container >div:nth-child(3) .list-value"
        },
        "qty": {
          "selector": ".product-item-details-container .list-row:last-child .list-value"
        },
        "productID": {
          "selector": ".product-item-number"
        }
      }
    ]
  }
}

