{
    "name": "bestbuy",
    "/purchasehistory/purchases": {
        "pageSubType": 1,        
        "deepScrape": {
            "enabled": true,
            "partialRollout": 50,            
			"waitForIntervals":4,
            "returnType": "json",           
            "httpConfig": [
                {
                    "url": "https://www.bestbuy.com/purchasehistory/rest/purchases?sorting=Relevance&years=2022",
                    "method": "GET",
                    "rateLimit":200
                },
                {
                    "url": "https://www.bestbuy.com/purchasehistory/rest/purchases?sorting=Relevance&years=2021",
                    "method": "GET",
                    "rateLimit":200
                },
                {
                    "url": "https://www.bestbuy.com/purchasehistory/rest/purchases?sorting=Relevance&years=2020",
                    "method": "GET",
                    "rateLimit":200
                }
            ]
        },
        "orders": [
            {
                "scriptJson": {},
                "row": {
                    "selector": "orderList.orders"
                },
                "cartTotal": {
                    "selector": "amount.total"
                },
                "orderDate": {
                    "selector": "date",
                    "manipulator": "splitGetByIndex:T:0"
                },
                "orderID": {
                    "selector": "id"
                },
                "purchaseLocation":{
                    "selector": "channel"
                }
            }
        ],
        "products": [
            {
                "scriptJson": {},
                "row": {
                    "selector": "lines"
                },
                "price": {
                    "selector": "sku.currentPrice"
                },
                "name": {
                    "selector": "sku.shortDesc"
                },
                "qty": {
                    "selector": "quantity"
                },
                "productID": {
                    "selector": "skuId"
                },
                "model": {
                    "selector": "sku.model"
                },
                "link": {
                    "selector": "sku.productLinks[0].linkUri"
                }
            }
        ]
    },
    "/profile/ss/orders/order-details/*": {
        "pageSubType": 2,
        "orders": [
            {
                "cartTotal": {
                    "selector": ".order-details-summary__order-total-and-toggle .dollar-amount"
                },
                "orderID": {
                    "selector": ".order-details-summary__order-number",
                    "manipulator": "splitGetByIndexLast:colon"
                },
                "orderDate": {
                    "selector": ".order-details-summary__order-date",
                    "manipulator": "splitGetByIndexLast:colon::formatDate:MMM DD, YYYY"
                }
            }
        ],
        "products": [
            {
                "row": {
                    "selector": ".fulfillment-group__item-row"
                },
                "name": {
                    "selector": ".sku-item-with-total__item-name a"
                },
                "link": {
                    "selector": ".sku-item-with-total__item-name a",
                    "useType": true
                },
                "productID": {
                    "selector": "[data-test='item-sku']",
                    "manipulator": "splitGetByIndexLast:colon"
                },
                "model": {
                    "selector": "[data-test='item-model']",
                    "manipulator": "splitGetByIndexLast:colon"
                },
                "price": {
                    "selector": "[data-test='item-total']"
                }
            }
        ]
    }
}

