        "pageSubType": 1,
        "deepScrape": {
            "enabled": true,
            "returnType": "json",            
			"waitForIntervals":4,
            "parentKey" : "orderID",
            "childPathKey" : "/cnc/myaccount/json/purchase_history_line_item.jsp",        
            "httpConfig": [
                {
                    "url": "https://www.kohls.com/cnc/myaccount/v2/purchase_history_json.jsp",
                    "method": "GET",
                    "rateLimit":200
                }
            ],
            "childHttpConfig": {
                "url": "https://www.kohls.com/cnc/myaccount/json/purchase_history_line_item.jsp?orderId={parentKey}&source=orderDetails",
                "method": "GET",
                "rateLimit":200
            }
        },
        "orders": [
            {
                "scriptJson" : {},
                "row": {
                    "selector": "orderHistoryInfo"
                },
                "orderID": {
                    "selector": "orderId"
                }
            }
        ]
    },
    "/cnc/myaccount/json/purchase_history_line_item.jsp": {        
        "pageSubType": 2,
        "orders": [
            {
                "scriptJson" : {},
               
                "orderID": {
                    "selector": "orderId"
                },
                "cartTotal": {
                    "selector": "orderSummary.subTotal"
                },
                "orderDate": {
                    "selector": "submittedDate",
                    "manipulator": "splitGetByIndex:day,:1::splitGetByIndex:at:0::formatDate:MMM DD, YYYY"
                },
                "paymentType":{
                    "selector": "paymentDetails.creditCardDetails[0].paymentType"
                }
            }
        ],
        "products": [
            {        
                "scriptJson" : {},        
                "row": {
                    "selector": "shipmentDetails[ALL].itemsDetails.itemStatus[ALL].lineItems"
                },
                "productID": {
                    "selector": "productId"
                },
                "name": {
                    "selector": "itemProperties.displayName"
                },
                "qty":{
                    "selector": "quantity"
                },
                "sku":{
                    "selector": "skuNumber"
                },
                "link":{
                    "selector": "itemProperties.seoURL"
                },
                "price":{
